import Logo from './components/Logo'
import Menu from './components/Menu'
import Theme from './components/Theme'
import Burger from './components/Burger'

const Header = ({className, data, isDarkTheme, onClickLogo, onClickTheme, onClickBurger}) => {
  const {
    name, 
    navigation: {
      menus: menuItems
    }
  } = data

  return (
    <header 
      data-name={name}
      className={className} 
    >
      <div className={`${className}__wrapper`}>
        <nav className={`${className}__nav`}>
          <Logo className={className} onClickLogo={onClickLogo}/>
          <Menu className={className} menuItems={menuItems}/>
        </nav>
        <Theme className={className} isDarkTheme={isDarkTheme} onClickTheme={onClickTheme}/>        
        <Burger className={className }/>
      </div>
    </header>
  )
}

export default Header
